- input: "TEXT\x1CC00089243\x1C.TEXT\x1C\x1CF3XA\x1CThe receipts from the Hotel Restaurant
    Institute Employees & Bartenders Union, IBEW-COPE on 11/6/06 and Choice One Communications
    were incorrectly characterized as a contributions when they are, in fact, other
    income resulting from the sale of the party's voter file.  Pricing of the file
    was determined based on previous market research and, therefore, does not result
    in a contribution.  It appears that this report was originally filed prior to
    amendments to earlier reports in 2006 resulting in a discrepancy in the calendar
    year-to-date totals on lines 21(a)(i), 21(a)(ii) and 32.  This report reflects
    the correct year-to-date totals.  No expenses contained in this report were made,
    in whole or in part, on behalf of a specifically identified federal candidate.
    \ The transfer from the Democratic National Committee received on 10/20/2006 for
    $3824.38 is supported by memo entries included in the Year-End Report totalling
    $4550.50."
